import React, { useState } from 'react';

function Tracker() {
  const [calories, setCalories] = useState('');
  const [protein, setProtein] = useState('');
  const [fat, setFat] = useState('');
  const [result, setResult] = useState('');

  const calculateIntake = () => {
    if (!calories || !protein || !fat) {
      setResult("Please fill in all values.");
      return;
    }
    setResult(`Calories: ${calories} kcal, Protein: ${protein} g, Fat: ${fat} g.`);
  };

  return (
    <div className="container">
      <h1>Calorie, Protein, and Fat Tracker</h1>
      <label>
        Calories (kcal):
        <input
          type="number"
          value={calories}
          onChange={(e) => setCalories(e.target.value)}
          placeholder="Enter calories"
        />
      </label>
      <label>
        Protein (g):
        <input
          type="number"
          value={protein}
          onChange={(e) => setProtein(e.target.value)}
          placeholder="Enter protein"
        />
      </label>
      <label>
        Fat (g):
        <input
          type="number"
          value={fat}
          onChange={(e) => setFat(e.target.value)}
          placeholder="Enter fat"
        />
      </label>
      <button onClick={calculateIntake}>Calculate Intake</button>
      <div className="result">{result}</div>
    </div>
  );
}

export default Tracker;
